BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "sous_nutrition" (
	"pays"	TEXT,
	" code_pays"	INTEGER,
	"nb_personnes"	REAL,
	"annee"	INTEGER,
	PRIMARY KEY(" code_pays")
);
CREATE TABLE IF NOT EXISTS "equilibre_prod" (
	"pays"	TEXT,
	"code_pays"	INTEGER NOT NULL,
	"année"	INTEGER NOT NULL,
	"produit"	TEXT NOT NULL,
	"code_produit"	INTEGER NOT NULL,
	"dispo_int"	REAL,
	"alim_ani"	REAL,
	"semences"	REAL,
	"pertes"	REAL,
	"transfo"	REAL,
	"nourriture"	REAL,
	"autres_utilisations"	REAL,
	PRIMARY KEY("code_pays","code_produit")
);
CREATE TABLE IF NOT EXISTS "dispo_alim" (
	"code_pays"	INTEGER NOT NULL,
	"pays"	TEXT,
	"année"	INTEGER NOT NULL,
	"code_produit"	INTEGER NOT NULL,
	"produit"	TEXT,
	"origin"	TEXT,
	"dispo_alim_kcal_p_j"	REAL,
	"dispo_prot"	REAL,
	"dispo_mat_gr"	REAL,
	"dispo_alim_tonnes"	REAL,
	PRIMARY KEY("code_pays","code_produit")
);
CREATE TABLE IF NOT EXISTS "population" (
	"pays"	TEXT NOT NULL,
	"code_pays"	INTEGER NOT NULL,
	"annee"	INTEGER NOT NULL,
	"population"	INTEGER NOT NULL,
	PRIMARY KEY("code_pays")
);
COMMIT;
